// HasSubmittedBy applies the HasEdge predicate on the "submitted_by" edge.
func HasSubmittedBy() predicate.DocumentRevision {
	return predicate.DocumentRevision(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, false, SubmittedByTable, SubmittedByColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.User
		step.Edge.Schema = schemaConfig.DocumentRevision
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSubmittedByWith applies the HasEdge predicate on the "submitted_by" edge with a given conditions (other predicates).
func HasSubmittedByWith(preds ...predicate.User) predicate.DocumentRevision {
	return predicate.DocumentRevision(func(s *sql.Selector) {
		step := newSubmittedByStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.User
		step.Edge.Schema = schemaConfig.DocumentRevision
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

